import React from "react";
import "./Items.css";

const Items = (props) => {
  const { items, deleteItem } = props;
  let lengthItems = items.length;
  // console.log(items);
  const ListItem = items.map((item) => {
    return (
      <div key={item.id}>
        <span>{item.id} </span>
        <span>{item.name}</span>
        <span>{item.age}</span>
        <span className="delete-item" onClick={() => deleteItem(item.id)}>
          &times;
        </span>
      </div>
    );
  });
  return (
    <div className="list-items">
      <div>
        <span>Name</span>
        <span>Age</span>
        <span>Delete</span>
      </div>
      <div>{ListItem}</div>
    </div>
  );
};

export default Items;
